import React, { Fragment } from "react";
class Form extends React.Component {
  render() {
    return (
      <form>
        <label>
          <input type="text" />
        </label>
        <label>
          <input type="text" />
        </label>
        <label>
          <input type="email" />
        </label>
        <label>
          <input type="password" />
        </label>
      </form>
    );
  }
}
export default Form;
